import React from 'react';
import BER from '../images/Bruce-new-heashot1.jpg';

function Team(props) {
    return (
        <div>
            <section>
                <p>We believe our team outshines the rest!</p>
            </section>

           <section className="homeSection3">
                <p>As Metro-Detroit's only full-service wound healing & infection facility, we're equipped with hosipital-quality modalities while giving patients the flexibility of outpatient care.</p>
                <img src={BER} alt="Dr. Bruce Ruben Headshot" className="homeSection1Pic"/>
            </section> 

            <section className="homeSection3">
                <img src={BER} alt="Dr. Bruce Ruben Headshot" className="homeSection1Pic"/>
                <p>As Metro-Detroit's only full-service wound healing & infection facility, we're equipped with hosipital-quality modalities while giving patients the flexibility of outpatient care.</p>
            </section> 


        </div>
    );
}

export default Team;
